{"query":"
    query PrerevealAsset($contractAddress: String!) {
  asset(where: {tokenId: {_eq: -1}, contractAddress: {_eq: $contractAddress}}) {
    sourceUri
    publicUrl
    mimeType
  }
}
    ","variables":{"contractAddress":"0xaB0e5DEcc4736b1Ce1A73C646a3f67Bb97325E05"}}

{"query":"
    query RecentPackMintsForCollection($collectionAddress: ID!, $limit: Limit) {
  items: recentPackMintsForCollection(
    collectionAddress: $collectionAddress
    limit: $limit
  ) {
    blockTimestamp
    user {
      accountAddress
      emailExists
      name
      username
      profileImageUrl
    }
    contractAddress
    numMinted
    nft {
      assetIpfsPath
      assetScheme
      assetHost
      assetPath
      assetId
      assetVersion
      assetStatus
      mimeType
      name
      tokenId
      id
    }
  }
}
    ","variables":{"collectionAddress":"0xaB0e5DEcc4736b1Ce1A73C646a3f67Bb97325E05","limit":4}}

{"query":"
    query AssetFallbackByArtworkIds($artworkIds: [uuid!]!) {
  asset(where: {artwork: {id: {_in: $artworkIds}}, quality: {_eq: "FALLBACK"}}) {
    ...AssetFragment
    artwork {
      id
    }
  }
}

    fragment AssetFragment on asset {
  id
  publicUrl
  quality
  contractAddress
  tokenId
  mimeType
}
    ","variables":{"artworkIds":["9d3de545-4209-484b-8c95-e1a938c6642f"]}}

