{"query":"
    query DropState($contractAddress: String!, $publicKey: String!) {
  collection(where: {contractAddress: {_eq: $contractAddress}}) {
    contractAddress
    isRevealed
    maxTokenId
    mintedCount: artworks_aggregate {
      aggregate {
        count
      }
    }
  }
  collectionSale: collection_sale(
    where: {contractAddress: {_eq: $contractAddress}}
  ) {
    id
    contractAddress
    saleType
    mintPrice
    limitPerWallet
    earlyAccessStartTime
    generalAvailabilityStartTime
  }
  allowlist: allow_list(where: {contractAddress: {_eq: $contractAddress}}) {
    id
    merkleRoot
    merkleTreeUri
    snapshotBlockNumber
    snapshotBlockTimestamp
    holderContractAddresses
  }
  allowlistUser: allow_list_user(
    where: {contractAddress: {_eq: $contractAddress}, publicKey: {_eq: $publicKey}}
  ) {
    merkleRoot
    contractAddress
    ownedContractAddresses
    publicKey
  }
}
    ","variables":{"publicKey":"","contractAddress":"0xaB0e5DEcc4736b1Ce1A73C646a3f67Bb97325E05"}}

{"query":"
