      publicKey: accountAddress
      username
    }
  }
  exhibitionMarket(slug: $slug) {
    availableNfts
    soldNfts
    totalSales
    liveAuctions
  }
}
    ","variables":{"id":1,"slug":"monolith-exhibition-x"}}

