{"query":"
    query UserActivityCount($publicKey: String!, $currentDate: timestamp!) {
  privateSalesCount: private_sale_aggregate(
    where: {deadlineAt: {_gt: $currentDate}, soldAt: {_is_null: true}, _or: [{buyer: {_eq: $publicKey}}, {seller: {_eq: $publicKey}}]}
  ) {
    aggregate {
      count
    }
  }
  placedBidsOpenCount: bid_aggregate(
    where: {bidder: {_eq: $publicKey}, auction: {status: {_eq: "OPEN"}}}
    distinct_on: auctionId
  ) {
    aggregate {
      count
    }
  }
  placedBidsEndedCount: bid_aggregate(
    where: {status: {_eq: "HIGHEST"}, auction: {status: {_eq: "ENDED"}, highestBidder: {_eq: $publicKey}}}
    distinct_on: auctionId
  ) {
    aggregate {
      count
    }
  }
  receivedBidsCount: auction_aggregate(
    where: {status: {_in: ["ENDED", "OPEN"]}, bids: {seller: {_eq: $publicKey}}}
    distinct_on: auctionId
  ) {
    aggregate {
      count
    }
  }
  receivedOffersCount: offer_aggregate(
    where: {artwork: {ownerPublicKey: {_eq: $publicKey}}, acceptedAt: {_is_null: true}, canceledAt: {_is_null: true}, status: {_eq: HIGHEST}, expiresAt: {_gt: $currentDate}}
  ) {
    aggregate {
      count
    }
  }
  madeOffersCount: offer_aggregate(
    where: {buyer: {_eq: $publicKey}, acceptedAt: {_is_null: true}, canceledAt: {_is_null: true}, status: {_nin: ["EXPIRED", "CANCELED"]}, expiresAt: {_gt: $currentDate}}
  ) {
    aggregate {
      count
    }
  }
}
    ","variables":{"publicKey":"0x7e4ABd63A7C8314Cc28D388303472353D884f292","currentDate":"2023-01-16T19:42:29.510Z"}}

